    def hesapla_fonksiyonu(self):
        iri_tuvenan_cevher_yogunlugu = self.doubleSpinBox.value()
        kabarma_faktoru = 1.5  # Kabarma faktÃ¶rÃ¼nÃ¼n deÄeri burada sabit alÄ±nmÄ±ÅtÄ±r.
        bulk_yogunluk = iri_tuvenan_cevher_yogunlugu / kabarma_faktoru
        self.outputBox.appendPlainText(f"Kabarma FaktÃ¶rÃ¼: {kabarma_faktoru} kabul edilmiÅtir.")
        self.outputBox.appendPlainText(f"Bulk YoÄunluÄu: {bulk_yogunluk} ton/m3 bulunmuÅtur.")
        # KÄ±rma Tesisinin bir haftalÄ±k ihtiyacÄ±nÄ± belirleyecek deÄeri ve hesaplamalarÄ±nÄ± burada yapÄ±nÄ±z.
        
        
    
        # Bir adet stok sahasÄ±nÄ±n hacmini hesapla
        
        stok_sev_acisi = self.spinBox_7.value()  # Bu spinBox'Ä±n stok Åev aÃ§Ä±sÄ±nÄ± temsil ettiÄini varsayÄ±yorum. Gerekirse dÃ¼zeltmelisiniz.
        stok_yuksekligi = self.spinBox_8.value()  # Bu spinBox'Ä±n stok yÃ¼ksekliÄini temsil ettiÄini varsayÄ±yorum. Gerekirse dÃ¼zeltmelisiniz.
        stok_uzunlugu = self.spinBox_9.value()  # Bu spinBox'Ä±n stok uzunluÄunu temsil ettiÄini varsayÄ±yorum. Gerekirse dÃ¼zeltmelisiniz.

        # Hesaplama iÃ§in tanÄ±mlar
        a = stok_yuksekligi
        c = stok_sev_acisi

        # Hesaplama
        ac_total = (4 * (a - c) / 2) + 4 * c  # Bu formÃ¼lÃ¼n doÄru olduÄunu varsayÄ±yorum. Gerekirse dÃ¼zeltmelisiniz.
        ac_total = bir_adet_stok_sahasi_hacmi / stok_uzunlugu  # FormÃ¼lÃ¼n son kÄ±smÄ±nÄ± ekliyoruz.

        self.outputBox.appendPlainText(f"a + c = {ac_total}")

        # Ãst taban ve yayÄ±lÄ±m uzunluklarÄ±
        stok_ust_taban_uzunlugu = ac_total * 0.25  # %25'ini al
        stok_yayilim_uzunlugu = ac_total * 0.75  # %75'ini al

        # SonuÃ§larÄ± output'a ekleyin
        self.outputBox.appendPlainText(f"Stok Ã¼st taban uzunluÄu: {stok_ust_taban_uzunlugu}")
        self.outputBox.appendPlainText(f"Stok yayÄ±lÄ±m uzunluÄu: {stok_yayilim_uzunlugu}")    
    
        T = self.hourly_capacity  # Saatlik Tesis Kapasitesi
        C = self.spinBox_11.value()  # Bu spinBox'Ä±n Teorik elek altÄ± miktarÄ±nÄ± temsil ettiÄini varsayÄ±yorum. Gerekirse dÃ¼zeltmelisiniz.
        E = self.spinBox_12.value()  # Bu spinBox'Ä±n eleme verimini temsil ettiÄini varsayÄ±yorum. Gerekirse dÃ¼zeltmelisiniz.

        # K deÄerini hesapla
        K = T * (1 - C * E)

        # SonuÃ§larÄ± output'a ekleyin
        self.outputBox.appendPlainText(f"K = {K} ton/saat KÄ±rÄ±cÄ±ya giren malzeme miktarÄ± olarak bulunur.")

        a = self.spinBox_13.value()  # KapalÄ± devrede elek Ã¼stÃ¼ miktarÄ±nÄ± temsil ettiÄini varsayÄ±yorum. Gerekirse dÃ¼zeltmelisiniz.
        b = 0.14  # KÄ±rÄ±cÄ±dan Ã§Ä±kan malzemenin Ã¶ngÃ¶rÃ¼len kÄ±rma boyutundan daha iri malzeme miktarÄ± 
        T = self.hourly_capacity  # Tesis Kapasitesi
        E = 0.85  # eleme verimi

        # DeÄerlerin kabul edildiÄini belirt
        self.outputBox.appendPlainText(f"KÄ±rÄ±cÄ±dan Ã§Ä±kan malzemenin Ã¶ngÃ¶rÃ¼len kÄ±rma boyutundan daha iri malzeme miktarÄ± {b} olarak kabul edilmiÅtir.")
        self.outputBox.appendPlainText(f"Eleme verimi {E} olarak kabul edilmiÅtir.")

        # R deÄerini hesapla
        R = T * (a / (1 - (b / E)))

        # SonuÃ§larÄ± output'a ekleyin
        self.outputBox.appendPlainText(f"Devreden yÃ¼k {R} ton/saat kÄ±rÄ±cÄ±ya giren malzeme miktarÄ± olarak bulunur.")

        beslenen_malzeme_miktari = self.spinBox_14.value()  # Beslenen Malzeme MiktarÄ±nÄ± temsil ettiÄini varsayÄ±yorum. Gerekirse dÃ¼zeltmelisiniz.
        cikis_acikligi = self.spinBox_15.value()  # ÃÄ±kÄ±Å AÃ§Ä±klÄ±ÄÄ±'nÄ± temsil ettiÄini varsayÄ±yorum. Gerekirse dÃ¼zeltmelisiniz.
        Wi = 12.49  # Kabullenilen deÄer
        D1 = self.spinBox_16.value()  # KÄ±rÄ±cÄ±ya beslenen malzemenin d80âi
        D2 = self.spinBox_17.value()  # KÄ±rÄ±cÄ±dan Ã§Ä±kan malzemenin d80âi
        K_emniyet = 1.25  # Kabullenilen deÄer

        # DeÄerlerin kabul edildiÄini belirt
        self.outputBox.appendPlainText(f"Wi: {Wi} olarak kabul edilmiÅtir.")
        self.outputBox.appendPlainText(f"K_emniyet: {K_emniyet} olarak kabul edilmiÅtir.")

        # Wt deÄerini hesapla
        Wt = 10 * Wi * ((1 / (D2 ** 0.5)) - (1 / (D1 ** 0.5)))

        # Sonucu output'a ekleyin
        self.outputBox.appendPlainText(f"Wt = {Wt} kWh/ton olarak bulunmuÅtur.")

        # GÃ¼Ã§ deÄerini hesapla
        guc = beslenen_malzeme_miktari * Wt * K_emniyet 

        # Sonucu output'a ekleyin
        self.outputBox.appendPlainText(f"GÃ¼Ã§ = {guc} kW olarak bulunmuÅtur.")

        # GÃ¼Ã§ deÄerini HP'ye dÃ¶nÃ¼ÅtÃ¼r ve sonucu output'a ekleyin
        guc_hp = guc * 1.341
        self.outputBox.appendPlainText(f"GÃ¼Ã§ = {guc_hp} HP olarak bulunmuÅtur.")


    
        

        
